import React from "react";
import { Link, Navigate } from "react-router-dom";

function PokeDetail({ poke }) {
    if (!pokemon) return <Navigate to="/" />

    return (
        <div className="pokemon-container">
            <h1>{poke.name}</h1>

            <Link to="/">Go back</Link>
        </div>
    )
}

export default PokeDetail;
